// ApartmentsForRent.js
import { Link } from "react-router-dom";
import React, { useEffect, useState } from "react";
import Product from "../product/Product";

const ApartmentsForRent = () => {
  const [Advertisement, setAdvertisement] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    async function fetchAdvertisement() {
      try {
        const response = await fetch('http://localhost:9000/users/allAdvertisement');
        const data = await response.json();

        if (response.ok) {
          setAdvertisement(data);
        } else {
          setError(error);
        }
      } catch (error) {
        console.log(error);
      } finally {
        setLoading(false);
      }
    }

    fetchAdvertisement();
  }, []);

  if (loading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div>Error: {error}</div>;
  }

  const apartmentsForRent = Advertisement.filter((ad) => ad.propertyType === 'land');

  return (
    <>
      {apartmentsForRent.map((ad, index) => (
        <Product key={ad._id} advertisement={ad} />
      ))}
    </>
  );
};

export default ApartmentsForRent;
